import './App.css';
import React from 'react'
import {BrowserRouter as Router} from 'react-router-dom';
import {Route, Routes } from 'react-router-dom'
import Header from './Components/header';


function App() {

  return (
    <div > 
    <Router>
      <Routes>
      <Route exact path="/"  element={<Header/>}/>

      </Routes>
    </Router>                 

    </div>
  );
}

export default App;
